import React from 'react';
import mealsjpeg from "../../images/image.jpeg"
import baklava from "../../../images/baklava.jpeg";
import modules from "./Header.module.css";
import HeaderBasketButton from './HeaderBasketButton';
const Header = (props) => {
  return (
  <React.Fragment >
  <header className={modules.header}> 
      <h1>React Meals</h1>
      <HeaderBasketButton onClick={props.onShowBasket}/>
  </header>
  <div className={modules["main-image"]}> 
   <img src={baklava} alt=""/>
  </div>; 
  </React.Fragment>
  )};

export default Header;
